import React, { useEffect, useState } from 'react';
import {Table} from './features/table/Table';
import './App.css';

function App() {
  const [sensors, setSensores] = useState(null);

  const fetchData = async ()=>{
    try{
      const response = await fetch('http://localhost:5000/listings');
      const SensorData = await response.json();
      console.log(SensorData);
      setSensores(SensorData);
    }catch(e){
      console.log(e.stack);
    }
  }

  useEffect( ()=> {fetchData()},[]);

  const data = React.useMemo(
    () => sensors.data,
    [sensors]
  )

  const columns = React.useMemo(
    () => [
      {
        Header: 'Id',
        accessor: '_id',
      },
      {
        Header: 'Timestamp',
        accessor: 'timestamp_day',
      },
      {
        Header: 'Name',
        accessor: 'name',
      },
      {
        Header: 'long',
        accessor: 'long',
      },
      {
        Header: 'lat',
        accessor: 'lat',
      },
      {
        Header: 'temperature',
        accessor: 'temperature',
      },
      {
        Header: 'humidity',
        accessor: 'humidity',
      },
      {
        Header: 'pH',
        accessor: 'pH',
      },
      {
        Header: 'pressure',
        accessor: 'pressure',
      },
      {
        Header: 'co2',
        accessor: 'co2',
      }
    ],
    []
  )

  return (
    <div className="App">
      <header className="App-header">
        {/* <img src={logo} className="App-logo" alt="logo" /> */}
        {/* <Counter /> */}
        <Table columns={columns} data={data}/>
        <div data = {sensors}></div>

      </header>
    </div>
  );
}

export default App;
